INSERT INTO `branches` VALUES (1,'Ciencias','Las ramas de la ciencia, disciplinas científicas, o simplemente ciencias, se suelen dividir en tres grupos: ciencias formales, ciencias naturales, y ciencias humanas o ciencias sociales. Estas conforman las ciencias básicas, sobre las que se apoyan las ciencias aplicadas como la ingeniería y la medicina.'),(2,'Arte y Humanidades','Se conoce como artes y humanidades a un área de estudio que agrupa a las profesiones que se dedican a resguardar, comprender y sistematizar el acervo cultural de un país, en sus diferentes épocas y manifestaciones.'),(3,'Ciencias de la Salud','Las ciencias de la salud son disciplinas que se ven relacionadas con la protección, el fomento y la restauración de la salud y de sus servicios'),(4,'Ingeniería y Arquitectura','En esta rama, las materias básicas tienen ciertas cosas en común, por ejemplo, se basan en algunas Ciencias Puras como Matemática, Física o Química con el fin de aplicarlas a problemas y situaciones de la vida real.');
/*!40000 ALTER TABLE `branches` ENABLE KEYS */;
